  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Crescent Lake
  National Wildlife Refuge outlines Refuge accomplishments from September through
  December of 1956. The report begins by summarizing the weather conditions, water
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  fish, and disease- is also covered. The Refuge development and maintenance section
  discusses physical developments. Resource management is outlined; topics include
  grazing and haying. The public relations section of the report describes recreational
  uses, Refuge visitors, and fishing. Items of interest, N-R forms, and photographs
  are attached. A short narrative report of North Platte National Wildlife Refuge
  is included.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
